import { GlobalContext } from '../context/GlobalState';

export const GraphSection = ({ mySymbol }) => {
  const { symbolToGraph } = useContext(GlobalContext);

  if(symbolToGraph.length>0)
    return (
      <div className='card mb-1 center'>
        <p><span className='text-warning'>({console.log(symbolToGraph)}) </span></p>
      </div>
    )
  else
    return (<></>)
}
